                 "width": 553.0,
                 "height": 302.0,
                 "optional": null,
                 "description": "You should play the early game safe (unless the enemy is dumb, then punish them). Use your pulse grenade (1) and carbine (3) to poke, and if they walk up punch them back. Remember that your pulse grenade''s damage amp applies to your punch as well. When you get swap you can start going all in. charge a carbine (3) --> wall (2) --> swap (4) --> fire carbine. If they''re dumb they''ll walk through your wall again as they try to escape and you can try to punch them on their way out. Build takes off once you get crushing fists as pulse grenades damage amp on your melee counts as a second hit doubling the amount of stacks you inflict. Build trophy collecter ASAP because the item is stupid once stacked."
               },
               {
                 "mods": [
